import React from 'react';
import './join_proposal_popup.css'; // Import your popup styling here

const JoinProposalPopup = ({ onClose }) => {
  return (
    <div className="join-proposal-popup">
      {/* Popup content goes here */}
      <input
          type="text"
          placeholder="전할 말"
          className="resume-popuptext input"
        />
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default JoinProposalPopup;
